create table chuni_game_character
(
    id              INTEGER,
    name            VARCHAR NOT NULL,
    release_tag      VARCHAR NOT NULL,
    works_name       VARCHAR NULL,
    illustrator_name VARCHAR NULL,
    first_skill_id    VARCHAR NULL,
    skills          VARCHAR NOT NULL,
    add_images       VARCHAR NOT NULL,
    PRIMARY KEY (
                 id
        )
);

create table chuni_game_skill
(
    id       INTEGER,
    name     VARCHAR NOT NULL,
    category VARCHAR NOT NULL,
    PRIMARY KEY (
                 id
        )
);


